import React from 'react';
import Link from "next/link";

const Layout = props => {
    return ( 
        <>
            <h1>Header</h1>

            <nav>
                <Link href="/">Principal</Link>
                <Link href="/nosotros">Nosotros</Link>
            </nav>

            <main>
                {props.children}
            </main>
        </>
     );
}
 
export default Layout;
